import React, {
  Component
} from 'react'
import {
  BrowserRouter as Router,
  Route,
  Switch
} from 'react-router-dom'
import UserList from './components/users/userList'
import Welcome from './components/index/welcome'
import UserAdd from './components/users/userAdd';
import Operations from './components/operations/login'
import Admin from "./components/operations/admin/Admin"
import Demo from "./components/test/Test"
import Country from "./components/operations/admin/masters/country/Country"
import './../src/assests/styles/MaterializeIcon.css';
import AddCountry from './components/operations/admin/masters/country/AddCountry';
import AddCE from './components/operations/admin/users/chiefexecutive/AddChiefExecutive'


export class App extends Component {
  render() {
    return ( <
      div >
      <
      Router >
      <
      Switch >
      <
      Route exact path = "/"
      component = {
        Welcome
      } > < /Route> <
      Route exact path = "/users"
      component = {
        UserList
      } > < /Route> <
      Route exact path = "/users/add"
      component = {
        UserAdd
      } > < /Route>


      <
      Route exact path = "/operations"
      component = {
        Operations
      } > < /Route> <
      Route exact path = "/operations/admin/masters/country"
      component = {
        Country
      } > < /Route> <
      Route exact path = "./"
      component = {
        Admin
      } > < /Route> <
      Route exact path = "/test"
      component = {
        Demo
      } > < /Route> <
      Route exact path = "/operations/admin/masters/country/add"
      component = {
        AddCountry
      } > < /Route> <
      Route exact path = "/operations/admin/masters/country/update"
      component = {
        AddCountry
      } > < /Route> <
      Route exact path = "/operations/admin/users/ce/add"
      component = {
        AddCE
      } > < /Route> <
      /Switch> <
      /Router> <
      /div>
    )
  }
}

export default App
